import React from 'react'
import './ProjectCard.css'

const ProjectCard = ({ projects }) => {
  return (
    <div className='card'>
       <img src={projects.image} />
       <div className='tegs'>
        {
          projects.tags?.map((tag,index) =>(
            <div className='tag'>{tag}</div>
          ))
        }
       </div>
    </div>
  )
}

export default ProjectCard
